import logo from './logo.svg'
import './App.css'
import Home from './pages/Home';
import Enter from './pages/Enter';
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <>
      <Routes>
        <Route index element={<Home/>}></Route>
        <Route path='/' element={<Home/>}></Route>
      </Routes>
    </>
  )
}

export default App;
